function ShoreLib() {
}

var shoreLib = new ShoreLib();

//shoreline object constructor
function shoreLine(n,h,sv) {   //name and shoreline vector
    this.name = n;             //name of index fossil
    this.handle = h;           //shoreline handle
    this.markers = new L.layerGroup();              //Layergroup created after reading and creating markers.
    this.gallery = ""          //String of related images for displaying the specimen.
    this.images = 0;
    this.initInfo = "";
    this.rocksHeader = '<table border=1 style="background-color: white;"><thead><tr><th>Dnum</th><th>State</th><th>County</th><th>Formation</th></tr></thead>';
    this.rocks = "";
    this.rocksEnd = '<table>';   
    this.rocksTable = function() {return this.rocksHeader + this.rocks + this.rocksEnd};
    
    //shoreline and popup
    this.shoreline = L.polyline(sv,{color: '#000000'});  //shoreline Leaflet polyline object
    this.linepopup = L.popup();
    this.linepopup.setContent(this.name);
    this.shoreline.bindPopup(this.linepopup);
    var hStr = h // This assignment needed so the following function call passes the handle
    this.shoreline.on('click', function(e) {lineClick(hStr)});
}

function makeGallery(n,h,im){  // fossil handle, full fossil name, number of images
    var galleryStr = "";
    for (var i=1; i <= im; i++){
        galleryStr += '<a ';
        if(i==1){galleryStr += 'id="' + h + 'Imgs" '};
        galleryStr += 'class="fancybox" href="images/' + h + '/' + h + i + '.jpg" data-fancybox-group="' + h + '" title="' + n + '"></a>';
    }
    return galleryStr;
}

function updateRocks(d, s, c, f) {  // marker object Dnum, State, County, Formation
    var rockRecord = "<tr><td>" + d + "</td>";
    rockRecord += "<td>" + s + "</td>";
    rockRecord += "<td>" + c + "</td>";
    rockRecord += "<td>" + f + "</td></tr>";
    return rockRecord;
}

//Convert vector into array of Leaflet lat-long arrays
//this is done immediately after object instantiated
function getShorelineVector(v) {
    var lls = [];
    for(i = 0; i < v.length; i++){
        lls[i] = L.latLng(v[i][0],v[i][1]);
    }
    return lls;
}

